import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function PerformanceChart({ data }) {
    // Veriyi ReCharts için uygun formata dönüştür
    const timeData = [
        {
            name: 'Sıralı Algoritma',
            value: data.sequential.time,
            fill: '#3498db'
        },
        {
            name: 'Temel Paralel',
            value: data.parallel.time,
            fill: '#e74c3c'
        },
        {
            name: 'Geliştirilmiş Paralel',
            value: data.improved.time,
            fill: '#2ecc71'
        },
        {
            name: 'Block-Based',
            value: data.blocked.time,
            fill: '#f1c40f'
        }
    ];

    const speedupData = [
        {
            name: 'Sıralı Algoritma',
            value: data.sequential.speedup,
            fill: '#3498db'
        },
        {
            name: 'Temel Paralel',
            value: data.parallel.speedup,
            fill: '#e74c3c'
        },
        {
            name: 'Geliştirilmiş Paralel',
            value: data.improved.speedup,
            fill: '#2ecc71'
        },
        {
            name: 'Block-Based',
            value: data.blocked.speedup,
            fill: '#f1c40f'
        }
    ];

    return (
        <div className="chart-wrapper">
            <h5 className="text-center mb-3">Çalışma Süresi Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={timeData}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis label={{ value: 'Çalışma Süresi (sn)', angle: -90, position: 'insideLeft' }} />
                    <Tooltip formatter={(value) => value.toFixed(6)} />
                    <Legend />
                    <Bar dataKey="value" name="Çalışma Süresi">
                        {timeData.map((entry, index) => (
                            <Bar key={`cell-${index}`} fill={entry.fill} />
                        ))}
                    </Bar>
                </BarChart>
            </ResponsiveContainer>

            <h5 className="text-center mb-3 mt-5">Hızlanma (Speedup) Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={speedupData}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis label={{ value: 'Hızlanma (Speedup)', angle: -90, position: 'insideLeft' }} />
                    <Tooltip formatter={(value) => value.toFixed(2)} />
                    <Legend />
                    <Bar dataKey="value" name="Hızlanma">
                        {speedupData.map((entry, index) => (
                            <Bar key={`cell-${index}`} fill={entry.fill} />
                        ))}
                    </Bar>
                </BarChart>
            </ResponsiveContainer>
        </div>
    );
}

export default PerformanceChart;
